INSERT INTO `blogs` (`id`, `title`, `image`, `content`, `count_view`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Are you one of the thousands of Iphone owners who has no idea', 'imageBlog/PX9gphoyN7OgpBTsAmZ0ZTm6VQyL5OJmnOKUauBg.jpg', '<p style=\"text-align:center\"><a href=\"https://www.pexels.com/photo/silhouette-of-city-buildings-during-night-time-12292899/\"><img alt=\"Free Silhouette of City Buildings during Night Time Stock Photo\" sizes=\"(max-width: 650px) calc((100vw - 30px - 15px) / 2), (max-width: 900px) calc((100vw - 30px - 15px) / 2), (max-width: 1440px) calc((100vw - 60px - 60px) / 3), (max-width: 1600px) calc((100vw - 160px - 60px) / 3), calc((1600pxpx - 160px - 60px) / 3)\" src=\"https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;dpr=1&amp;w=500\" srcset=\"https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=150&amp;lazy=load 150w, https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=300&amp;lazy=load 300w, https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=400&amp;lazy=load 400w, https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=600&amp;lazy=load 600w, https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=800&amp;lazy=load 800w, https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=1200&amp;lazy=load 1200w, https://images.pexels.com/photos/12292899/pexels-photo-12292899.jpeg?auto=compress&amp;cs=tinysrgb&amp;w=1600&amp;lazy=load 1600w\" /></a></p>\r\n\r\n<p>Hydroderm is the highly desired anti-aging cream on the block. This serum restricts the occurrence of early aging sings on the skin and keeps the skin younger, tighter and healthier. It reduces the wrinkles and loosening of skin. This cream nourishes the skin and brings back the glow that had lost in the run of hectic years.</p>\r\n\r\n<p>The most essential ingredient that makes hydroderm so effective is Vyo-Serum, which is a product of natural selected proteins. This concentrate works actively in bringing about the natural youthful glow of the skin. It tightens the skin along with its moisturizing effect on the skin. The other important ingredient, making hydroderm so effective is &ldquo;marine collagen&rdquo; which along with Vyo-Serum helps revitalize the skin.</p>\r\n\r\n<div style=\"background:#f3f2ee; border-radius:5px; margin-bottom:45px; padding:15px 25px 15px; position:relative\">\r\n<p><em>&ldquo;When designing an advertisement for a particular product many things should be researched like where it should be displayed.&rdquo;</em></p>\r\n\r\n<h5><span style=\"color:#e74c3c\">_ JOHN SMITH _</span></h5>\r\n</div>\r\n\r\n<p>Vyo-Serum along with tightening the skin also reduces the fine lines indicating aging of skin. Problems like dark circles, puffiness, and crow&rsquo;s feet can be control from the strong effects of this serum.</p>\r\n\r\n<p>Hydroderm is a multi-functional product that helps in reducing the cellulite and giving the body a toned shape, also helps in cleansing the skin from the root and not letting the pores clog, nevertheless also let&rsquo;s sweeps out the wrinkles and all signs of aging from the sensitive near the eyes.</p>', 0, 1, '2022-07-24 04:05:50', '2022-07-25 08:10:16', NULL),
