INSERT INTO `categories` (`id`, `name`, `slug`, `avatar`, `status`, `created_at`, `updated_at`, `deleted_at`, `major_category_id`) VALUES
(1, 'Áo thun nam', 'Mỗi năm áo thun nam 4MEN lại có những biến hóa khác nhau để phù hợp với xu hướng thời trang đang hiện hành và hiện nay những kiểu áo thun họa tiết, phối chữ rất được các tín đồ thời trang mến mộ hay những chiếc áo thun với kiểu dáng đơn giản, dễ kết hợp cùng nhiều loại thời trang khác nhau cũng rất được lòng phái mạnh.', 'avatarCategories/uZNWi3HFI77W7Vi5b0hRmZZj55ENu7oCB4wcmkSn.png', 1, '2022-07-22 18:46:56', '2022-07-25 07:33:58', NULL, 1),
(2, 'Áo sơ mi', 'Áo sơ mi nam luôn là trang phục lựa chọn hàng đầu của nhiều chàng trai, bởi sự tiện ích và tính thời trang mà nó mang lại cho người mặc. Tại 4MEN, chúng tôi thường xuyên cập nhật những mẫu áo sơ mi mới từ kiểu dáng trơn, sọc caro đến sơ mi phối họa tiết…, nhằm giúp khách hàng lựa chọn được những sản phẩm đẹp, chất lượng phù hợp với nhu cầu và sở thích của mình một cách dễ dàng nhất.', 'avatarCategories/w5cNGjfEXgr37FxVKEGmCXl5jvBOl7DQ4R3XViBH.png', 1, '2022-07-22 19:41:31', '2022-07-22 19:41:31', NULL, 1),
(3, 'Quần Jean Nam', 'Lọc danh mục  Sắp xếp: Mặc định Quần jeans nam là trang phục có giá trị và thông dụng nhất trong tủ quần áo. Với những ưu điểm như chắc, bền, đẹp, các sản phẩm làm từ chất liệu jean mang lại cho người mặc, nhất là các chàng trai, vẻ ngoài mạnh mẽ và phong cách. Để chọn được một chiếc quần jeans phù hợp, bạn có thể đến với 4MEN, chúng tôi thường xuyên cập nhật những mẫu quần jean nam đẹp và thời trang nhất từ quần jean skinny, quần jean nam rách cho đến quần jean ống đứng…', 'avatarCategories/K215GFgRJe9pXGRMmCxFynAjoEExFWJl0mEhZQUZ.jpg', 1, '2022-07-22 19:45:33', '2022-07-24 08:03:13', NULL, 2),
(4, 'Túi đeo chéo', 'Túi đeo chéo', 'avatarCategories/BcFgscNr7bsBgxcezuzKTI7OSiAZ7pU1iP0sim7Q.png', 1, '2022-08-01 21:20:56', '2022-08-01 21:20:56', NULL, 3),
(5, 'Giày Nam', 'Giày nam tại 4MEN phù hợp với thị hiếu  nhiều đối tượng khách hàng khác nhau. Bạn dễ dàng tìm thấy những đôi giày lười hiện đại, hay những đôi giày thể thao năng động, cho đến giày tây tại văn phòng sang trọng…. Dù là kiểu giày nào chúng tôi vẫn luôn giúp bạn tạo nên những phong cách thời trang ấn tượng nhất. Giày nam tại 4MEN luôn được thiết kế và sản xuất với chất liệu da bò thật 100%, đa dạng kiểu dáng từ lịch lãm, cổ điển đến thời trang, sang trọng', 'avatarCategories/hH92eltdxkdZ4jz2AEE6Huwc0zinyqZ6QTlk21jT.png', 1, '2022-08-03 09:13:46', '2022-09-19 15:34:31', NULL, 4);
