(5, 5, 'GIÀY TÂY 4MEN G002', 695000.00, 17, 'giay-tay-4men-g002', '<p>Nam tempus turpis at metus scelerisque placerat nulla deumantos solicitud felis. Pellentesque diam dolor, elementum etos lobortis des mollis ut risus. Sedcus faucibus an sullamcorper mattis drostique des commodo pharetras loremos.</p>\r\n\r\n<h5><strong>Products Infomation about GI&Agrave;Y T&Acirc;Y 4MEN G002</strong></h5>\r\n\r\n<p>A Pocket PC is a handheld computer, which features many of the same capabilities as a modern PC. These handy little devices allow individuals to retrieve and store e-mail messages, create a contact file, coordinate appointments, surf the internet, exchange text messages and more. Every product that is labeled as a Pocket PC must be accompanied with specific software to operate the unit and must feature a touchscreen and touchpad.</p>\r\n\r\n<p>As is the case with any new technology product, the cost of a Pocket PC was substantial during it&rsquo;s early release. For approximately $700.00, consumers could purchase one of top-of-the-line Pocket PCs in 2003. These days, customers are finding that prices have become much more reasonable now that the newness is wearing off. For approximately $350.00, a new Pocket PC can now be purchased.</p>\r\n\r\n<h5><strong>Material used</strong></h5>\r\n\r\n<p>Polyester is deemed lower quality due to its none natural quality&rsquo;s. Made from synthetic materials, not natural like wool. Polyester suits become creased easily and are known for not being breathable. Polyester suits tend to have a shine to them compared to wool and cotton suits, this can make the suit look cheap. The texture of velvet is luxurious and breathable. Velvet is a great choice for dinner party jacket and can be worn all year round.</p>', 14, 1, '2022-08-03 09:17:33', '2022-10-28 09:02:11', NULL),
(6, 2, 'ÁO SƠ MI OXFORD TAY NGẮN ASM017', 245000.00, 11, 'ao-so-mi-oxford-tay-ngan-asm017', '<p>nao si</p>', 27, 1, '2022-08-25 15:14:35', '2022-12-23 03:57:03', NULL),
